import { GeoLocation } from "./Geolocation";

export async function getConnection() {
    try {
        const coords = GeolocationPosition().coords;
        const response = await fetch(`https://cors-anywhere.herokuapp.com/https://www.metaweather.com/api/location/latlong=${coords}/`);
        const data = await response.json();
        console.log(response);
        //console.log(data);
    } catch (error) {
        console.log('ERROR');
    }
}
